注意以下几点：\\r\\n *\\r\\n * 1.请不要删除和修改根目录下的LICENSE文件。\\r\\n * 2.请不要删除和修改Snowy源码头部的版权声明。\\r\\n * 3.本项目代码可免费商业使用，商业使用请保留源码和相关描述文件的项目出处，作者声明等。\\r\\n * 4.分发源码时候，请注明软件出处 https://www.xiaonuo.vip\\r\\n * 5.不可二次分发开源参与同类竞品，如有想法可联系团队xiaonuobase@qq.com商议合作。\\r\\n * 6.若您的项目无法满足以上几点，需要更多功能代码，获取Snowy商业授权许可，请在官网购买授权，地址为 https://www.xiaonuo.vip\\r\\n */\\r\\npackage me.zhangyifeng.scooter.modular.scooter.service;\\r\\n\\r\\nimport com.baomidou.mybatisplus.extension.plugins.pagination.Page;\\r\\nimport com.baomidou.mybatisplus.extension.service.IService;\\r\\nimport me.zhangyifeng.scooter.modular.scooter.entity.Scooter;\\r\\nimport me.zhangyifeng.scooter.modular.scooter.param.ScooterAddParam;\\r\\nimport me.zhangyifeng.scooter.modular.scooter.param.ScooterEditParam;\\r\\nimport me.zhangyifeng.scooter.modular.scooter.param.ScooterIdParam;\\r\\nimport me.zhangyifeng.scooter.modular.scooter.param.ScooterPageParam;\\r\\n\\r\\nimport java.util.List;\\r\\n\\r\\n/**\\r\\n * scooterService接口\\r\\n *\\r\\n * @author 张一风\\r\\n * @date  2025/02/09 21:06\\r\\n **/\\r\\npublic interface ScooterService extends IService<Scooter> {\\r\\n\\r\\n    /**\\r\\n     * 获取scooter分页\\r\\n     *\\r\\n     * @author 张一风\\r\\n     * @date  2025/02/09 21:06\\r\\n     */\\r\\n    Page<Scooter> page(ScooterPageParam scooterPageParam);\\r\\n\\r\\n    /**\\r\\n     * 添加scooter\\r\\n     *\\r\\n     * @author 张一风\\r\\n     * @date  2025/02/09 21:06\\r\\n     */\\r\\n    void add(ScooterAddParam scooterAddParam);\\r\\n\\r\\n    /**\\r\\n     * 编辑scooter\\r\\n     *\\r\\n     * @author 张一风\\r\\n     * @date  2025/02/09 21:06\\r\\n     */\\r\\n    void edit(ScooterEditParam scooterEditParam);\\r\\n\\r\\n    /**\\r\\n     * 删除scooter\\r\\n     *\\r\\n     * @author 张一风\\r\\n     * @date  2025/02/09 21:06\\r\\n     */\\r\\n    void delete(List<ScooterIdParam> scooterIdParamList);\\r\\n\\r\\n    /**\\r\\n     * 获取scooter详情\\r\\n     *\\r\\n     * @author 张一风\\r\\n     * @date  2025/02/09 21:06\\r\\n     */\\r\\n    Scooter detail(ScooterIdParam scooterIdParam);\\r\\n\\r\\n    /**\\r\\n     * 获取scooter详情\\r\\n     *\\r\\n     * @author 张一风\\r\\n     * @date  2025/02/09 21:06\\r\\n     **/\\r\\n    Scooter queryEntity(String id);\\r\\n}\\r\\n\"},{\"codeFileName\":\"ScooterServiceImpl.java\",\"codeFileWithPathName\":\"me\\\\zhangyifeng\\\\scooter\\\\modular\\\\scooter\\\\service\\\\impl\\\\ScooterServiceImpl.java\",\"codeFileContent\":\"/*\\r\\n * Copyright [2022] [https://www.xiaonuo.vip]\\r\\n *\\r\\n * Snowy采用APACHE LICENSE 2.0开源协议，您在使用过程中，需要注意以下几点：\\r\\n *\\r\\n * 1.请不要删除和修改根目录下的LICENSE文件。\\r\\n * 2.请不要删除和修改Snowy源码头部的版权声明。\\r\\n * 3.本项目代码可免费商业使用，商业使用请保留源码和相关描述文件的项目出处，作者声明等。\\r\\n * 4.分发源码时候，请注明软件出处 https://www.xiaonuo.vip\\r\\n * 5.不可二次分发开源参与同类竞品，如有想法可联系团队xiaonuobase@qq.com商议合作。\\r\\n * 6.若您的项目无法满足以上几点，需要更多功能代码，获取Snowy商业授权许可，请在官网购买授权，地址为 https://www.xiaonuo.vip\\r\\n */\\r\\npackage me.zhangyifeng.scooter.modular.scooter.service.impl;\\r\\n\\r\\nimport cn.hutool.core.bean.BeanUtil;\\r\\nimport cn.hutool.core.collection.CollStreamUtil;\\r\\nimport cn.hutool.core.util.ObjectUtil;\\r\\nimport cn.hutool.core.util.StrUtil;\\r\\nimport com.baomidou.mybatisplus.core.conditions.query.QueryWrapper;\\r\\nimport com.baomidou.mybatisplus.extension.plugins.pagination.Page;\\r\\nimport com.baomidou.mybatisplus.extension.service.impl.ServiceImpl;\\r\\nimport org.springframework.stereotype.Service;\\r\\nimport org.springframework.transaction.annotation.Transactional;\\r\\nimport me.zhangyifeng.common.enums.CommonSortOrderEnum;\\r\\nimport me.zhangyifeng.common.exception.CommonException;\\r\\nimport me.zhangyifeng.common.page.CommonPageRequest;\\r\\nimport me.zhangyifeng.scooter.modular.scooter.entity.Scooter;\\r\\nimport me.zhangyifeng.scooter.modular.scooter.mapper.ScooterMapper;\\r\\nimport me.zhangyifeng.scooter.modular.scooter.param.ScooterAddParam;\\r\\nimport me.zhangyifeng.scooter.modular.scooter.param.ScooterEditParam;\\r\\nimport me.zhangyifeng.scooter.modular.scooter.param.ScooterIdParam;\\r\\nimport me.zhangyifeng.scooter.modular.scooter.param.ScooterPageParam;\\r\\nimport me.zhangyifeng.scooter.modular.scooter.service.ScooterService;\\r\\n\\r\\nimport java.util.List;\\r\\n\\r\\n/**\\r\\n * scooterService接口实现类\\r\\n *\\r\\n * @author 张一风\\r\\n * @date  2025/02/09 21:06\\r\\n **/\\r\\n@Service\\r\\npublic class ScooterServiceImpl extends ServiceImpl<ScooterMapper, Scooter> implements ScooterService {\\r\\n\\r\\n    @Override\\r\\n    public Page<Scooter> page(ScooterPageParam scooterPageParam) {\\r\\n        QueryWrapper<Scooter> queryWrapper = new QueryWrapper<Scooter>().checkSqlInjection();\\r\\n        if(ObjectUtil.isNotEmpty(scooterPageParam.getScooterName())) {\\r\\n            queryWrapper.lambda().like(Scooter::getScooterName, scooterPageParam.getScooterName());\\r\\n        }\\r\\n        if(ObjectUtil.isNotEmpty(scooterPageParam.getBrand())) {\\r\\n            queryWrapper.lambda().like(Scooter::getBrand, scooterPageParam.getBrand());\\r\\n        }\\r\\n        if(ObjectUtil.isNotEmpty(scooterPageParam.getStatus())) {\\r\\n            queryWrapper.lambda().eq(Scooter::getStatus, scooterPageParam.getStatus());\\r\\n        }\\r\\n        if(ObjectUtil.isNotEmpty(scooterPageParam.getBatteryLevel())) {\\r\\n            queryWrapper.lambda().eq(Scooter::getBatteryLevel, scooterPageParam.getBatteryLevel());\\r\\n        }\\r\\n        if(ObjectUtil.isAllNotEmpty(scooterPageParam.getSortField(), scooterPageParam.getSortOrder())) {\\r\\n            CommonSortOrderEnum.validate(scooterPageParam.getSortOrder());\\r\\n            queryWrapper.orderBy(true, scooterPageParam.getSortOrder().equals(CommonSortOrderEnum.ASC.getValue()),\\r\\n                    StrUtil.toUnderlineCase(scooterPageParam.getSortField()));\\r\\n        } else {\\r\\n            queryWrapper.lambda().orderByAsc(Scooter::getId);\\r\\n        }\\r\\n        return this.page(CommonPageRequest.defaultPage(), queryWrapper);\\r\\n    }\\r\\n\\r\\n    @Transactional(rollbackFor = Exception.class)\\r\\n    @Override\\r\\n    public void add(ScooterAddParam scooterAddParam) {\\r\\n        Scooter scooter = BeanUtil.toBean(scooterAddParam, Scooter.class);\\r\\n        this.save(scooter);\\r\\n    }\\r\\n\\r\\n    @Transactional(rollbackFor = Exception.class)\\r\\n    @Override\\r\\n    public void edit(ScooterEditParam scooterEditParam) {\\r\\n        Scooter scooter = this.queryEntity(scooterEditParam.getId());\\r\\n        BeanUtil.copyProperties(scooterEditParam, scooter);\\r\\n        this.updateById(scooter);\\r\\n    }\\r\\n\\r\\n    @Transactional(rollbackFor = Exception.class)\\r\\n    @Override\\r\\n    public void delete(List<ScooterIdParam> scooterIdParamList) {\\r\\n        // 执行删除\\r\\n        this.removeByIds(CollStreamUtil.toList(scooterIdParamList, ScooterIdParam::getId));\\r\\n    }\\r\\n\\r\\n    @Override\\r\\n    public Scooter detail(ScooterIdParam scooterIdParam) {\\r\\n        return this.queryEntity(scooterIdParam.getId());\\r\\n    }\\r\\n\\r\\n    @Override\\r\\n    public Scooter queryEntity(String id) {\\r\\n        Scooter scooter = this.getById(id);\\r\\n        if(ObjectUtil.isEmpty(scooter)) {\\r\\n            throw new CommonException(\\\"scooter不存在，id值为：{}\\\", id);\\r\\n        }\\r\\n        return scooter;\\r\\n    }\\r\\n}\\r\\n\"}]}}', '2025-02-09 21:06:09', '超管', 'f4ed00dfc56c32c671f3a8dcaaa87a3457d71152e11d0c24f11614326f2c901d30b51d4643e316f5639976211bd698d704228642d0bf01d8ceaae301f6b1c386', '2025-02-09 21:06:09', '1543837863788879871', NULL, NULL);
