eImpl extends ServiceImpl<ScootersMapper, Scooters> implements ScootersService {\\r\\n\\r\\n    @Override\\r\\n    public Page<Scooters> page(ScootersPageParam scootersPageParam) {\\r\\n        QueryWrapper<Scooters> queryWrapper = new QueryWrapper<Scooters>().checkSqlInjection();\\r\\n        if(ObjectUtil.isNotEmpty(scootersPageParam.getScooterName())) {\\r\\n            queryWrapper.lambda().like(Scooters::getScooterName, scootersPageParam.getScooterName());\\r\\n        }\\r\\n        if(ObjectUtil.isNotEmpty(scootersPageParam.getBrand())) {\\r\\n            queryWrapper.lambda().like(Scooters::getBrand, scootersPageParam.getBrand());\\r\\n        }\\r\\n        if(ObjectUtil.isNotEmpty(scootersPageParam.getStatus())) {\\r\\n            queryWrapper.lambda().eq(Scooters::getStatus, scootersPageParam.getStatus());\\r\\n        }\\r\\n        if(ObjectUtil.isNotEmpty(scootersPageParam.getBatteryLevel())) {\\r\\n            queryWrapper.lambda().eq(Scooters::getBatteryLevel, scootersPageParam.getBatteryLevel());\\r\\n        }\\r\\n        if(ObjectUtil.isNotEmpty(scootersPageParam.getStartLastMaintenanceDate()) && ObjectUtil.isNotEmpty(scootersPageParam.getEndLastMaintenanceDate())) {\\r\\n            queryWrapper.lambda().between(Scooters::getLastMaintenanceDate, scootersPageParam.getStartLastMaintenanceDate(), scootersPageParam.getEndLastMaintenanceDate());\\r\\n        }\\r\\n        if(ObjectUtil.isAllNotEmpty(scootersPageParam.getSortField(), scootersPageParam.getSortOrder())) {\\r\\n            CommonSortOrderEnum.validate(scootersPageParam.getSortOrder());\\r\\n            queryWrapper.orderBy(true, scootersPageParam.getSortOrder().equals(CommonSortOrderEnum.ASC.getValue()),\\r\\n                    StrUtil.toUnderlineCase(scootersPageParam.getSortField()));\\r\\n        } else {\\r\\n            queryWrapper.lambda().orderByAsc(Scooters::getId);\\r\\n        }\\r\\n        return this.page(CommonPageRequest.defaultPage(), queryWrapper);\\r\\n    }\\r\\n\\r\\n    @Transactional(rollbackFor = Exception.class)\\r\\n    @Override\\r\\n    public void add(ScootersAddParam scootersAddParam) {\\r\\n        Scooters scooters = BeanUtil.toBean(scootersAddParam, Scooters.class);\\r\\n        this.save(scooters);\\r\\n    }\\r\\n\\r\\n    @Transactional(rollbackFor = Exception.class)\\r\\n    @Override\\r\\n    public void edit(ScootersEditParam scootersEditParam) {\\r\\n        Scooters scooters = this.queryEntity(scootersEditParam.getId());\\r\\n        BeanUtil.copyProperties(scootersEditParam, scooters);\\r\\n        this.updateById(scooters);\\r\\n    }\\r\\n\\r\\n    @Transactional(rollbackFor = Exception.class)\\r\\n    @Override\\r\\n    public void delete(List<ScootersIdParam> scootersIdParamList) {\\r\\n        // 执行删除\\r\\n        this.removeByIds(CollStreamUtil.toList(scootersIdParamList, ScootersIdParam::getId));\\r\\n    }\\r\\n\\r\\n    @Override\\r\\n    public Scooters detail(ScootersIdParam scootersIdParam) {\\r\\n        return this.queryEntity(scootersIdParam.getId());\\r\\n    }\\r\\n\\r\\n    @Override\\r\\n    public Scooters queryEntity(String id) {\\r\\n        Scooters scooters = this.getById(id);\\r\\n        if(ObjectUtil.isEmpty(scooters)) {\\r\\n            throw new CommonException(\\\"滑板管理不存在，id值为：{}\\\", id);\\r\\n        }\\r\\n        return scooters;\\r\\n    }\\r\\n}\\r\\n\"}]}}', '2025-02-10 12:55:46', '超管', '682696f7a024d20ed96a74bcb203aa3c337f9a49571c8215615de07cf9c0cbcbfbd423960fd0c10b588b366aa3ab95b9b7b91774b84a25d63124be9e155330a9', '2025-02-10 12:55:47', '1543837863788879871', NULL, NULL);
