a)\\r\\n    }\\r\\n    const close = () => {\\r\\n    \\tpopRef.value.close()\\r\\n    }\\r\\n    defineExpose({\\r\\n    \\topen\\r\\n    })\\r\\n</script>\\r\\n<style lang=\\\"scss\\\" scoped>\\r\\n</style>\\r\\n\"},{\"codeFileName\":\"form.vue\",\"codeFileWithPathName\":\"pages\\\\user\\\\user\\\\form.vue\",\"codeFileContent\":\"<template>\\r\\n    <view class=\\\"snowy-form\\\">\\r\\n        <uni-forms ref=\\\"formRef\\\" :model=\\\"formData\\\" label-position=\\\"top\\\" :rules=\\\"rules\\\" validate-trigger=\\\"blur\\\" labelWidth=\\\"auto\\\">\\r\\n            <uni-forms-item label=\\\"头像\\\" name=\\\"avatar\\\" :required=\\\"false\\\" :rules=\\\"[{ required: false, errorMessage: \'请输入头像\' }]\\\">\\r\\n            \\t<uni-easyinput v-model=\\\"formData.avatar\\\" placeholder=\\\"请输入头像\\\"></uni-easyinput>\\r\\n            </uni-forms-item>\\r\\n            <uni-forms-item label=\\\"签名\\\" name=\\\"signature\\\" :required=\\\"false\\\" :rules=\\\"[{ required: false, errorMessage: \'请输入签名\' }]\\\">\\r\\n            \\t<uni-easyinput v-model=\\\"formData.signature\\\" placeholder=\\\"请输入签名\\\"></uni-easyinput>\\r\\n            </uni-forms-item>\\r\\n            <uni-forms-item label=\\\"账号\\\" name=\\\"account\\\" :required=\\\"false\\\" :rules=\\\"[{ required: false, errorMessage: \'请输入账号\' }]\\\">\\r\\n            \\t<uni-easyinput v-model=\\\"formData.account\\\" placeholder=\\\"请输入账号\\\"></uni-easyinput>\\r\\n            </uni-forms-item>\\r\\n            <uni-forms-item label=\\\"密码\\\" name=\\\"password\\\" :required=\\\"false\\\" :rules=\\\"[{ required: false, errorMessage: \'请输入密码\' }]\\\">\\r\\n            \\t<uni-easyinput v-model=\\\"formData.password\\\" placeholder=\\\"请输入密码\\\"></uni-easyinput>\\r\\n            </uni-forms-item>\\r\\n            <uni-forms-item label=\\\"姓名\\\" name=\\\"name\\\" :required=\\\"false\\\" :rules=\\\"[{ required: false, errorMessage: \'请输入姓名\' }]\\\">\\r\\n            \\t<uni-easyinput v-model=\\\"formData.name\\\" pla