则大全：https://any86.github.io/any-rule/\\r\\n    // 去pages/biz/user/form.vue中寻找示例\\r\\n    const rules = reactive({\\r\\n    })\\r\\n    onLoad((option) => {\\r\\n        if(!option.id){\\r\\n            return\\r\\n        }\\r\\n        pricingApi.pricingDetail({\\r\\n            id: option.id\\r\\n        }).then(data => {\\r\\n            formData.value = data\\r\\n        })\\r\\n    })\\r\\n    const submit = () => {\\r\\n        formRef.value.validate().then(res => {\\r\\n            pricingApi.pricingSubmitForm(formData.value, !formData.value.id).then(data => {\\r\\n                uni.$emit(\'formBack\', {\\r\\n                    data: data\\r\\n                })\\r\\n                uni.navigateBack({\\r\\n                    delta: 1\\r\\n                })\\r\\n            })\\r\\n        })\\r\\n    }\\r\\n</script>\\r\\n<style lang=\\\"scss\\\" scoped>\\r\\n</style>\\r\\n\"},{\"codeFileName\":\"more.vue\",\"codeFileWithPathName\":\"pages\\\\pricing\\\\pricing\\\\more.vue\",\"codeFileContent\":\"<template>\\r\\n    <uni-popup ref=\\\"popRef\\\" type=\\\"bottom\\\" background-color=\\\"transparent\\\" maskBackgroundColor=\\\"rgba(0, 0, 0, 0.6)\\\">\\r\\n        <tui-list-view unlined=\\\"all\\\" background-color=\\\"transparent\\\">\\r\\n            <tui-list-cell v-if=\\\"$snowy.hasPerm(\'mobilePricingEdit\')\\\" :hover=\\\"true\\\" :arrow=\\\"false\\\" @click=\\\"edit\\\" :radius=\\\"10\\\" >\\r\\n                <view class=\\\"snowy-text-center\\\"> 编辑 </view>\\r\\n            </tui-list-cell>\\r\\n            <tui-list-cell v-if=\\\"$snowy.hasPerm(\'mobilePricingDelete\')\\\" :hover=\\\"true\\\" :arrow=\\\"false\\\" @click=\\\"del\\\" :radius=\\\"10\\\" :margin-top=\\\"2\\\">\\r\\n                <view class=\\\"snowy-text-center\\\"> 刪除 </view>\\r\\n            </tui-list-cell>\\r\\n            <tui-list-cell :hover=\\\"true\\\" :arrow=\\\"false\\\" @click=\\\"cancel\\\" :margin-top=\\\"10\\\" :radius=\\\"10\\\">\\r\\n                <view class=\\