rops.searchFormData.endTime = \'\'\\r\\n        props.searchFormData.totalCost = \'\'\\r\\n        props.searchFormData.status = \'\'\\r\\n    \\temits(\'reset\', props.searchFormData)\\r\\n    }\\r\\n    const confirm = () => {\\r\\n    \\tpopRef.value.close()\\r\\n    \\temits(\'confirm\', props.searchFormData)\\r\\n    }\\r\\n    const close = () => {\\r\\n    \\tpopRef.value.close()\\r\\n    }\\r\\n    defineExpose({\\r\\n    \\topen\\r\\n    })\\r\\n</script>\\r\\n<style lang=\\\"scss\\\" scoped>\\r\\n</style>\\r\\n\"},{\"codeFileName\":\"form.vue\",\"codeFileWithPathName\":\"pages\\\\rental\\\\rental\\\\form.vue\",\"codeFileContent\":\"<template>\\r\\n    <view class=\\\"snowy-form\\\">\\r\\n        <uni-forms ref=\\\"formRef\\\" :model=\\\"formData\\\" label-position=\\\"top\\\" :rules=\\\"rules\\\" validate-trigger=\\\"blur\\\" labelWidth=\\\"auto\\\">\\r\\n            <uni-forms-item label=\\\"USER_ID\\\" name=\\\"userId\\\" :required=\\\"false\\\" :rules=\\\"[{ required: false, errorMessage: \'请输入USER_ID\' }]\\\">\\r\\n            \\t<uni-easyinput v-model=\\\"formData.userId\\\" placeholder=\\\"请输入USER_ID\\\"></uni-easyinput>\\r\\n            </uni-forms-item>\\r\\n            <uni-forms-item label=\\\"SCOOTER_ID\\\" name=\\\"scooterId\\\" :required=\\\"false\\\" :rules=\\\"[{ required: false, errorMessage: \'请输入SCOOTER_ID\' }]\\\">\\r\\n            \\t<uni-easyinput v-model=\\\"formData.scooterId\\\" placeholder=\\\"请输入SCOOTER_ID\\\"></uni-easyinput>\\r\\n            </uni-forms-item>\\r\\n            <uni-forms-item label=\\\"START_TIME\\\" name=\\\"startTime\\\" :required=\\\"false\\\" :rules=\\\"[{ required: false, errorMessage: \'请选择START_TIME\' }]\\\">\\r\\n                <uni-datetime-picker type=date v-model=\\\"formData.startTime\\\" > </uni-datetime-picker>\\r\\n            </uni-forms-item>\\r\\n            <uni-forms-item label=\\\"END_TIME\\\" name=\\\"endTime\\\" :required=\\\"false\\\" :rules=\\\"[{ required: false, errorMessage: \'请选择END_