_COST\\\"></uni-easyinput>\\r\\n            </uni-forms-item>\\r\\n            <uni-forms-item label=\\\"STATUS\\\" name=\\\"status\\\" :required=\\\"false\\\" :rules=\\\"[{ required: false, errorMessage: \'请选择STATUS\' }]\\\">\\r\\n                <uni-data-checkbox :multiple=\\\"false\\\" :map=\\\"{key: \'value\', label: \'text\'}\\\" v-model=\\\"formData.status\\\" :rangeData=\\\"statusOptions\\\" placeholder=\\\"请选择STATUS\\\"> </uni-data-checkbox>\\r\\n            </uni-forms-item>\\r\\n            <uni-forms-item label=\\\"CREATED_AT\\\" name=\\\"createdAt\\\" :required=\\\"false\\\" :rules=\\\"[{ required: false, errorMessage: \'请选择CREATED_AT\' }]\\\">\\r\\n                <uni-datetime-picker type=date v-model=\\\"formData.createdAt\\\" > </uni-datetime-picker>\\r\\n            </uni-forms-item>\\r\\n            <uni-forms-item label=\\\"UPDATED_AT\\\" name=\\\"updatedAt\\\" :required=\\\"false\\\" :rules=\\\"[{ required: false, errorMessage: \'请选择UPDATED_AT\' }]\\\">\\r\\n                <uni-datetime-picker type=date v-model=\\\"formData.updatedAt\\\" > </uni-datetime-picker>\\r\\n            </uni-forms-item>\\r\\n        </uni-forms>\\r\\n        <tui-button margin=\\\"50rpx 0\\\" :preventClick=\\\"true\\\" :shadow=\\\"true\\\" @click=\\\"submit\\\">提交</tui-button>\\r\\n    </view>\\r\\n</template>\\r\\n\\r\\n<script setup name=\\\"rentalForm\\\">\\r\\n    import { onLoad } from \\\"@dcloudio/uni-app\\\"\\r\\n    import rentalApi from \'@/api/rental/rental-api\'\\r\\n    import { reactive, ref, getCurrentInstance } from \\\"vue\\\"\\r\\n    import CallbackState from \\\"@/enum/callback-state\\\"\\r\\n\\r\\n    const { proxy } = getCurrentInstance()\\r\\n    const formRef = ref()\\r\\n    const formData = ref({})\\r\\n    // 常用正则规则大全：https://any86.github.io/any-rule/\\r\\n    // 去pages/biz/user/form.vue中寻找示例\\r\\n    const rules = reactive({\\r\\n    })\\r\\n    const statusOptions = ref([])\\t\\r\\n    onLoad((option) => {\\r\\n        statusOptions.value = uni.$snowy.tool.dictList(\'1\')\\r\\n        if(!option.id){\\r\\n            return\\r\\n        }\\r\\n        rentalApi.rentalDetail({\\r\\n            id: option.id\\r\\n        }).then(data => {\\r\\n            formData.value = data\\r\\n        })\\r\\n    })\\r\\n    const submit = () => {\\r\\n        formRef.value.validate().then(res => {\\r\\n            rentalApi.rentalSubmitForm(formData.value, !formData.value.id).then(data => {\\r\\n                uni.$emit(\'formBack\', {\\r\\n                    data: data\\r\\n                })\\r\\n                uni.navigateBack({\\r\\n                    delta: 1\\r\\n                })\\r\\n            })\\r\\n        })\\r\\n    }\\r\\n</script>\\r\\n<style lang=\\\"scss\\\" scoped>\\r\\n</style>\\r\\n\"},{\"codeFileName\":\"more.vue\",\"codeFileWithPathName\":\"pages\\\\rental\\\\rental\\\\more.vue\",\"codeFileContent\":\"<template>\\r\\n    <uni-popup ref=\\\"popRef\\\" type=\\\"bottom\\\" background-color=\\\"transparent\\\" maskBackgroundColor=\\\"rgba(0, 0, 0, 0.6)\\\">\\r\\n        <tui-list-view unlined=\\\"all\\\" background-color=\\\"transparent\\\">\\r\\n            <tui-list-cell v-if=\\\"$snowy.hasPerm(\'mobileRentalEdit\')\\\" :hover=\\\"true\\\" :arrow=\\\"false\\\" @click=\\\"edit\\\" :radius=\\\"10\\\" >\\r\\n                <view class=\\\"snowy-text-center\\\"> 编辑 </view>\\r\\n            </tui-list-cell>\\r\\n            <tui-list-cell v-if=\\\"$snowy.hasPerm(\'mobileRentalDelete\')\\\" :hover=\\\"true\\\" :arrow=\\\"false\\\" @click=\\\"del\\\" :radius=\\\"10\\\" :margin-top=\\\"2\\\">\\r\\n                <view class=\\\"snowy-text-center\\\"> 刪除 </view>\\r\\n            </tui-list-cell>\\r\\n            <tui-list-cell :hover=\\\"true\\\" :arrow=\\\"false\\\" @click=\\\"cancel\\\" :margin-top=\\\"10\\\" :radius=\\\"10\\\">\\r\\n                <view class=\\\"snowy-text-center\\\"> 取消 </view>\\r\\n            </tui-list-cell>\\r\\n        </tui-list-view>\\r\\n    </uni-popup>\\r\\n</t