\\n        return this.page(CommonPageRequest.defaultPage(), queryWrapper);\\r\\n    }\\r\\n\\r\\n    @Transactional(rollbackFor = Exception.class)\\r\\n    @Override\\r\\n    public void add(AreasAddParam areasAddParam) {\\r\\n        Areas areas = BeanUtil.toBean(areasAddParam, Areas.class);\\r\\n        this.save(areas);\\r\\n    }\\r\\n\\r\\n    @Transactional(rollbackFor = Exception.class)\\r\\n    @Override\\r\\n    public void edit(AreasEditParam areasEditParam) {\\r\\n        Areas areas = this.queryEntity(areasEditParam.getId());\\r\\n        BeanUtil.copyProperties(areasEditParam, areas);\\r\\n        this.updateById(areas);\\r\\n    }\\r\\n\\r\\n    @Transactional(rollbackFor = Exception.class)\\r\\n    @Override\\r\\n    public void delete(List<AreasIdParam> areasIdParamList) {\\r\\n        // 执行删除\\r\\n        this.removeByIds(CollStreamUtil.toList(areasIdParamList, AreasIdParam::getId));\\r\\n    }\\r\\n\\r\\n    @Override\\r\\n    public Areas detail(AreasIdParam areasIdParam) {\\r\\n        return this.queryEntity(areasIdParam.getId());\\r\\n    }\\r\\n\\r\\n    @Override\\r\\n    public Areas queryEntity(String id) {\\r\\n        Areas areas = this.getById(id);\\r\\n        if(ObjectUtil.isEmpty(areas)) {\\r\\n            throw new CommonException(\\\"区域管理表不存在，id值为：{}\\\", id);\\r\\n        }\\r\\n        return areas;\\r\\n    }\\r\\n}\\r\\n\"}],\"genBasicCodeMobileResultList\":[{\"codeFileName\":\"page.json\",\"codeFileWithPathName\":\"\\\\page.json\",\"codeFileContent\":\"// 二选一 将代码复制到page.json文件中\\r\\n\\r\\n// 不使用分包\\r\\n{\\r\\n    \\\"path\\\": \\\"pages/biz/area/index\\\",\\r\\n    \\\"style\\\": {\\r\\n        \\\"navigationBarTitleText\\\": \\\"区域管理表管理\\\",\\r\\n        \\\"enablePullDownRefresh\\\": false,\\r\\n        //#ifdef H5\\r\\n        \\\"navigationStyle\\\": \\\"custom\\\"\\r\\n        //#endif\\r\\n    }\\r\\n}, {\\r\\n    \\\"path\\\": \\\"pages/biz/area/form\\\",\\r\\n    \\\"style\\\": {\\r\\n        \\\"navigationBarTitleText